import Box from "./Box";

const Row = ({
  rowData,
  rowNum,
  circle,
  topColorRed,
  selectedPiece,
  setSelectedPiece,
  potentialMoves,
  setPotentialMoves,
}) => {
  return (
    <div className="row">
      {rowData.map((el, boxNum) => (
        <Box
          rowNum={rowNum}
          boxData={el}
          boxNum={boxNum}
          circle={circle}
          topColorRed={topColorRed}
          selectedPiece={selectedPiece}
          setSelectedPiece={setSelectedPiece}
          potentialMoves={potentialMoves}
          setPotentialMoves={setPotentialMoves}
          rowNums={rowNums}
        />
      ))}
    </div>
  );
};

export default Row;
